import React, { Component } from 'react';
import { createFilter } from './Filter';
import { createSorter } from './sort';
import ReactTable from 'react-table';
import "react-table/react-table.css";

var data = require('./provider.json');

var test1 = {
  region: {
  property: 'Region',
  value: '',
}
};


class ProviderList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      filters: this.props.filters,
      sorter: this.props.sorter
  };
}


  static defaultProps = {
    filters: [{
      property: 'Type',
      value: ''
    }, {
      property: test1.region.property,
      value: test1.region.value
    }, {
      property: 'County',
      value: ''
    }, {
      property: 'WCHR',
      value: ''
    }, {
      property: 'Stretcher',
      value: ''
    }],
    sorter: [{
      property: 'name'
    }, {
      property: 'county'
    }]
  };
  
  componentDidMount () {
    fetch(`/provider.json`)
      .then(res => res.json());
       
  }

  parseData(data) {
    const { sorter } = this.state;

    if (data && data.length) {
      if (Array.isArray(sorter) && sorter.length) {
        data.sort(createSorter(...sorter));
      }
    }

    return data;
  }

  

  render() {
    //const  data   = this.parseData(data);
    return this.parseData(data) ? this.renderData(data) : this.renderLoading();
  }

  renderData(data) {
    const { filters } = this.state;
    
    if (data && data.length > 0) {
      if (Array.isArray(filters) && filters.length) {
        data = data.filter(createFilter(...filters));
      }
      return (
        <div>
          
          <ReactTable 
          data={data}
          columns={[
            {
              Header: "Provider",
              columns: [
                {
                  Header: "Name",
                  accessor: "Name",
                  sortMethod: (a, b) => {
                    if (a.length === b.length) {
                      return a > b ? 1 : -1;
                    }
                    return a.length > b.length ? 1 : -1;
                  }
                }
              ]
            },
            {
              Header: "Type",
              columns: [
                {
                  Header: "Type",
                  accessor: "Type"
                }
              ]
            },
            {
              Header: "Region",
              columns: [
                {
                  Header: "Region",
                  accessor: "Region",
                }
              ]
            },
            {
              Header: "County",
              columns: [
                {
                  Header: "County",
                  accessor: "County"
                }
              ]
            },
            {
              Header: "Level of Service",
              columns: [
                {
                  Header: "Ambulatory",
                  accessor: "Amb"
                },
                {
                  Header: "Wheelchair",
                  id: "WCHR",
                  accessor: d => d.WCHR
                },
                {
                  Header: "Stretcher",
                  id: "Stretcher",
                  accessor: d => d.Stretcher
                }
              ]
            },
          ]}
          defaultPageSize={20}
          style={{
            height: "400px" // This will force the table body to overflow and scroll, since there is not enough room
          }}
          className= "Provider-table"
        />
            {/*
              <table 
              defaultPageSize={20}
              className="Provider-table">
              <tr>
                <th>Type</th>
                <th>Provider Name</th>
                <th>Provider Region</th>
                <th>County</th>
                <th>Ambulatory</th>
                <th>Wheelchair</th>
                <th>Stretcher</th>
              </tr>
              {data.map(item => (
                <tr key={item.id}>
                  <td>{item.Type}</td>
                  <td>{item.Name}</td>
                  <td>{item.Region}</td>
                  <td>{item.County}</td>
                  <td>{item.Amb}</td>
                  <td>{item.WCHR}</td>
                  <td>{item.Stretcher}</td>
                </tr>
              ))}
              </table>*/}
          
        </div>
      );
    } else {
      return <div>No items found</div>;
    }
  }

  renderLoading() {
    return <div>Loading...</div>;
  }
}

export default ProviderList;


